    public class ValuesController : ApiController
    {
        // GET api/values
        [SwaggerOperation("Post")]
        public async Task<string> Post()
        {
            string json = Request.Content.ReadAsStringAsync().Result;
            JObject requestBody = JObject.Parse(json);
            if (requestBody["url"] != null)
            {
                return await this.EvaluateCustomDNN((string)requestBody["url"], (string)requestBody["rois"]);
            }
            else
            {
                return "Please post target image url";
            }
        }

        public async Task<string> EvaluateCustomDNN(string imageUrl, string inputRois)
        //public static void EvaluationSingleImage(DeviceDescriptor device)
        {
            try
            {
                string domainBaseDirectory = AppDomain.CurrentDomain.BaseDirectory;
                string workingDirectory = Environment.CurrentDirectory;
                DeviceDescriptor device = DeviceDescriptor.CPUDevice;

                // Place your model in the folder
                string modelFilePath = Path.Combine(domainBaseDirectory, @"CNTK\Models\frcn_nn.model");
                Function modelFunc = Function.Load(modelFilePath, device);

                // Get input variable. The model has only one single input.
                // The same way described above for output variable can be used here to get input variable by name.
                Variable inputVar = modelFunc.Arguments.First();
                // Get shape data for the input variable
                NDShape inputShape = inputVar.Shape;
                int imageWidth = inputShape[0];
                int imageHeight = inputShape[1];
                int imageChannels = inputShape[2];
                int imageSize = inputShape.TotalSize;

                // The model has only one output.
                // If the model have more than one output, use the following way to get output variable by name.
                var inputDataMap = new Dictionary<Variable, Value>();

                // Image preprocessing to match input requirements of the model.
                // This program uses images from the CIFAR-10 dataset for evaluation.
                // Please see README.md in <CNTK>/Examples/Image/DataSets/CIFAR-10 about how to download the CIFAR-10 dataset.
                // Transform the image
                System.Net.Http.HttpClient httpClient = new HttpClient();
                Stream imageStream = await httpClient.GetStreamAsync(imageUrl);
                Bitmap bmp = new Bitmap(Bitmap.FromStream(imageStream));
                var resized = bmp.Resize((int)imageWidth, (int)imageHeight, true);

                List<float> resizedCHW = resized.ParallelExtractCHW();
                // Create input data map
                var inputVal = Value.CreateBatch(inputVar.Shape, resizedCHW, device);
                Variable inputVar2 = modelFunc.Arguments.Last();

                List<float> rois = new List<float> { };
                if (inputRois == null) {
                    rois = getSampleRois().GetRange(0, inputVar2.Shape[0] * inputVar2.Shape[1]);
                } else {
                    rois = getRois(inputRois).GetRange(0, inputVar2.Shape[0] * inputVar2.Shape[1]);
                }

                string roisjson = JsonConvert.SerializeObject(rois);
                var inputVal2 = Value.CreateBatch(inputVar2.Shape, rois, device);

                inputDataMap.Add(inputVar, inputVal);
                inputDataMap.Add(inputVar2, inputVal2);

                // Create ouput data map. Using null as Value to indicate using system allocated memory.
                // Alternatively, create a Value object and add it to the data map.
                Variable outputVar = modelFunc.Output;
                var outputDataMap = new Dictionary<Variable, Value>();
                outputDataMap.Add(outputVar, null);

                // Start evaluation on the device
                modelFunc.Evaluate(inputDataMap, outputDataMap, device);

                // Get evaluate result as dense output
                var outputVal = outputDataMap[outputVar];
                var outputData = outputVal.GetDenseData<float>(outputVar);
                var result = getMaxProbability(outputData.First());
                return JsonConvert.SerializeObject(result);

            }
            catch (Exception ex)
            {
                Console.WriteLine("Error: {0}\nCallStack: {1}\n Inner Exception: {2}", ex.Message, ex.StackTrace, ex.InnerException != null ? ex.InnerException.Message : "No Inner Exception");
                throw ex;
            }
        }
        private static Dictionary<string, float> getMaxProbability(IList<float> outputs)
        {
            var labels = new[] { "__background__", "one", "two", "three", "four", "five", "six", "seven", "eight", "nine", "zero" };
            int numLabels = labels.Length;
            int numRois = outputs.Count / numLabels;
            var maxProbability = new Dictionary<string, float>() { };
            foreach (string label in labels) { maxProbability.Add(label, 0); }
            for (int i = 0; i < numRois; i++)
                if (maxProbability[labels[i % numLabels]] < outputs[i])
                    maxProbability[labels[i % numLabels]] = outputs[i];
            return maxProbability;
        }

        private List<float> getRois(string roiCoordinates)
        {
            return roiCoordinates.Split(' ').Select(x => float.Parse(x)).ToList();
        }

